from sympy.utilities.iterables import partitions
def a_row(n, length=11) -> list[int]:
    if n == 0 : return list(range(1, length + 1))
    t = [0] * length
    for p in partitions(n):
        fact = 1
        s = 0
        for k in p :
            s += p[k]
            fact *= p[k] + 1
        if s > 0 :
            t[s] += fact
    for i in range(1, length - 1):
        t[i+1] += t[i] * 2 - t[i-1]
    return t
for n in range(11): print(a_row(n))

